import React, {Component} from 'react';
//引入样式
import '../../style/layoutcss/layoutcss.scss';
class Layout extends Component {
    render() {
        return (
            <div>
                {/*头部*/}
                <div className="header">
                    {/*定位区块*/}
                    <div className="location">
                        <span className="location-icon iconfont icon-dingwei"></span>
                        <span className="location-text">成都市</span>
                        {/*<span className="location-choose iconfont icon-plus-select-down"></span>*/}

                    </div>

                </div>
            </div>
        );
    }
}

export default Layout;
